></h3>\n<h1 class=\"display-1\">Display 1</h1>\n<h1 class=\"display-2\">Display 2</h1>\n<h1 class=\"display-3\">Display 3</h1>\n<h1 class=\"display-4\">Display 4</h1>\n<h1 class=\"display-5\">Display 5</h1>\n<h1 class=\"display-6\">Display 6</h1>\n<p class=\"lead\">This is a lead paragraph. It stands out from regular paragraphs.</p>\n<p>You can use the mark tag to <mark>highlight</mark> text.</p>\n<p><del>This line of text is meant to be treated as deleted text.</del></p>\n<p><s>This line of text is meant to be treated as no longer accurate.</s></p>\n<p><ins>This line of text is meant to be treated as an addition to the document.</ins></p>\n<p><u>This line of text will render as underlined.</u></p>\n<p><small>This line of text is meant to be treated as fine print.</small></p>\n<p><strong>This line rendered as bold text.</strong></p>\n<p><em>This line rendered as italicized text.</em></p>\n<p><abbr title=\"attribute\">attr</abbr></p>\n<p><abbr class=\"initialism\" title=\"HyperText Markup Language\">HTML</abbr></p>\n<blockquote class=\"blockquote\">\n<p>A well-known quote, contained in a blockquote element.</p>\n</blockquote>\n<figure>\n<blockquote class=\"blockquote\">\n<p>A well-known quote, contained in a blockquote element.</p>\n</blockquote>\n<figcaption>Someone famous in <cite title=\"Source Title\">Source Title</cite></figcaption>\n</figure>\n<figure>\n<blockquote class=\"blockquote\">\n<p>A well-known quote, contained in a blockquote element.</p>\n</blockquote>\n<figcaption>Someone famous in <cite title=\"Source Title\">Source Title</cite></figcaption>\n</figure>\n<figure>\n<blockquote class=\"blockquote\">\n<p>A well-known quote, contained in a blockquote element.</p>\n</blockquote>\n<figcaption>Someone famous in <cite title=\"Source Title\">Source Title</cite></figcaption>\n</figure>\n<ul class=\"list-unstyled\">\n<li>This is a list.</li>\n<li>It appears completely unstyled.</li>\n<li>Structurally, it&#39;s still a list.</li>\n<li>However, this style only applies to immediate child elements.</li>\n<li>Nested lists:\n<ul>\n<li>are unaffected by this style</li>\n<li>will still show a bullet</li>\n<li>and have appropriate left margin</li>\n</ul>\n</li>\n<li>This may still come in handy in some situations.</li>\n</ul>\n<ul class=\"list-inline\">\n<li class=\"list-inline-item\">This is a list item.</li>\n<li class=\"list-inline-item\">And another one.</li>\n<li class=\"list-inline-item\">But they&#39;re displayed inline.</li>\n</ul>\n<dl class=\"row\">\n<dt class=\"col-sm-3\">Description lists</dt>\n<dd class=\"col-sm-9\">A description list is perfect for defining terms.</dd>\n<dt class=\"col-sm-3\">Term</dt>\n<dd class=\"col-sm-9\">\n<p>Definition for the term.</p>\n<p>And some more placeholder definition text.</p>\n</dd>\n<dt class=\"col-sm-3\">Another term</dt>\n<dd class=\"col-sm-9\">This definition is short, so no extra paragraphs or anything.</dd>\n<dt class=\"col-sm-3 text-truncate\">Truncated term is truncated</dt>\n<dd class=\"col-sm-9\">This can be useful when space is tight. Adds an ellipsis at the end.</dd>\n<dt class=\"col-sm-3\">Nesting</dt>\n<dd class=\"col-sm-9\">\n<dl class=\"row\">\n<dt class=\"col-sm-4\">Nested definition list</dt>\n<dd class=\"col-sm-8\">I heard you like definition lists. Let me put a definition list inside your definition list.</dd>\n</dl>\n</dd>\n</dl>', NULL, '', '', '', NULL, '', 'above', NULL, NULL, '', NULL, NULL, '', 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, '', '', '', '', NULL, 4, 0, 0, '', '', '', NULL, '', '', NULL, '', NULL, '0', '0', '', '', '', '', NULL, NULL, 0, 300, 0, NULL, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', 'ascending', 0, '', 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', '', NULL, 'main');
