en zu testen. In Lateinisch sieht zum Beispiel fast jede Schrift gut aus. Quod erat demonstrandum.</p>', NULL, '', '', '', NULL, '', 'above', NULL, NULL, '', NULL, NULL, '', 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, '', '', '', '', NULL, 4, 0, 0, '', '', '', NULL, '', '', NULL, '', NULL, '0', '0', '', '', '', '', NULL, NULL, 0, 300, 0, NULL, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:6:\"grid12\";}', '', '', 'ascending', 0, '', 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', '', NULL, 'main');
