 Verfügung:\n<ul>\n<li>Fullwidth-Layout</li>\n<li>Layout mit rechter Spalte</li>\n</ul>\n</li>\n<li><strong>Backend-Grid (WYSIWYG)</strong><br>Ein übersichtliches Grid-System im Backend erleichtert Redakteuren die visuelle Zuordnung von Inhalten.</li>\n<li><strong>Responsive Navigation</strong><br>Die Hauptnavigation passt sich automatisch an verschiedene Bildschirmgrößen an.</li>\n<li><strong>Mobile Navigation</strong><br>Separate mobile Navigation zur verbesserten Darstellung auf kleineren Geräten.</li>\n<li><strong>Cookie-Bar</strong><br>Integrierte Cookie-Bar zur Umsetzung datenschutzrechtlicher Anforderungen.</li>\n</ul>\n<h2>Browser-Kompatibilität</h2>\n<p>Das Theme ist mit folgenden Browsern getestet:</p>\n<ul>\n<li>Opera</li>\n<li>Safari</li>\n<li>Firefox</li>\n<li>Microsoft Edge</li>\n<li>Google Chrome</li>\n</ul>\n<h2>Systemanforderungen</h2>\n<ul>\n<li>Contao 5.5.10 oder höher</li>\n<li>Fly UX Erweiterung</li>\n</ul>', NULL, '', '', '', NULL, '', 'above', NULL, NULL, '', NULL, NULL, '', 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, '', '', '', '', NULL, 4, 0, 0, '', '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', '', '', NULL, NULL, 0, 300, 0, NULL, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:5:\"grid8\";}', '', '', 'ascending', 0, '', 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', '', NULL, 'main');
